/*
 * NSTable Messages
 *
 * This contains all the text for the NSTable component.
 */

import { defineMessages } from 'react-intl';

export const scope = 'app.component.NSTable';

export default defineMessages({
  all: {
    id: `${scope}.all`,
    defaultMessage: 'All',
  },
  add: {
    id: `${scope}.add`,
    defaultMessage: 'Add',
  },
  createSurvReq: {
    id: `${scope}.createSurvReq`,
    defaultMessage: 'Create Survey Requests',
  },
  columns: {
    id: `${scope}.columns`,
    defaultMessage: 'Columns',
  },
  customField: {
    id: `${scope}.customField`,
    defaultMessage: 'Custom Field',
  },
  density: {
    id: `${scope}.density`,
    defaultMessage: 'Density',
  },
  export: {
    id: `${scope}.export`,
    defaultMessage: 'Export',
  },
  filters: {
    id: `${scope}.filters`,
    defaultMessage: 'Filters',
  },
  field: {
    id: `${scope}.field`,
    defaultMessage: 'Field',
  },
  itemsSelected: {
