    defaultMessage: 'items',
  },
  next: {
    id: `${scope}.next`,
    defaultMessage: 'Next',
  },
  of: {
    id: `${scope}.of`,
    defaultMessage: 'of',
  },
  prev: {
    id: `${scope}.prev`,
    defaultMessage: 'Prev',
  },
  requests: {
