    defaultMessage: 'Save Changes',
  },
  tableSettings: {
    id: `${scope}.tableSettings`,
    defaultMessage: 'Table Settings',
  },
  reset: {
    id: `${scope}.reset`,
    defaultMessage: 'Reset',
  },
  resultsPerPage: {
    id: `${scope}.resultsPerPage`,
    defaultMessage: 'Results per page',
  },
  reorder: {
    id: `${scope}.reorder`,
    defaultMessage: 'Re-Order...',
  },
  reorderDesc: {
    id: `${scope}.reorderDesc`,
    defaultMessage: 'Drag column label to reorder',
