    defaultMessage:
      'This will create a new custom view with your current filter and table settings.',
  },
  inputPlaceholder: {
    id: `${scope}.inputPlaceholder`,
    defaultMessage: 'Enter a name for this view...',
  },
  noRequests: {
    id: `${scope}.noRequests`,
    defaultMessage: 'No requests found',
  },
});
